        <div className='atomicSymbol' style={{backgroundColor:props.test}}>
            <h1> {props.symbol}</h1>
        </div>
        <div className='atomicName'  style={{backgroundColor:props.test}}>
            <h2>{props.name}</h2>
        </div>
    </div>
    
}

